function updateGraph() {
	if(profiles.length==0){
			document.getElementById("splash").innerHTML = "YOU'RE DONE";
			document.getElementById("splash").style = "display:block;height:100%;width:100%;position:absolute;left:0;top:0;background-color:white;font-size:50px;";
			return;
		}
	
	profileNumber = Math.floor(Math.random() * profiles.length)	
	profile = profiles[profileNumber];
	var salinities = [];
	var temperatures = [];
	var densities= [];
	document.getElementById("UR").innerHTML = "You are: " + localStorage.getItem("name");

	for(i=0;i<profile["pressures"].length;i++){
		temperatures.push({"x":profile["temperatures"][i],"y":-profile["pressures"][i]})	
	}
	for(i=0;i<profile["pressures"].length;i++){
		salinities.push({"x":profile["salinities"][i],"y":-profile["pressures"][i]})	
	}
	for(i=0;i<profile["pressures"].length;i++){
		densities.push({"x":profile["densities"][i],"y":-profile["pressures"][i]})	
	}
	dx.data.datasets[0].data = densities;
	dx.data.datasets[1].data = temperatures;
	dx.data.datasets[2].data = salinities;
	document.getElementById("info").innerHTML= "lat: " + profile["lat"].toString() + " lon: " + profile["lon"].toString() + " date: " + profile["date"].toString() ;
	document.getElementById("left").innerHTML= "There are " +profiles.length+" profiles left.";
	dx.update();
}
document.getElementById('name').onkeypress = function(e){
    if (!e) e = window.event;
    var keyCode = e.keyCode || e.which;
    if (keyCode == '13'){
			localStorage.setItem("name", document.getElementById("name").value);
			document.getElementById("splash").style="display:none;";
      return false;
    }
 }
updateGraph()
document.getElementById("densityChart").onclick = function (evt) {
	var points = dx.getElementsAtEvent(evt);
	console.log(points);
	if(points[0]) {
		answers.push({"depth":profile["pressures"][points[0]._index],"id":profile.name});
		postData('https://hidden-brook-86362.herokuapp.com/mld/create',{"profileName":profile.name,"depth":profile["pressures"][points[0]._index],"identifierName":localStorage.getItem("name")})
		.then(data => console.log(data)) // JSON-string from `response.json()` call
		.catch(error => console.error(error));
	profiles.splice(profileNumber,1)
		localStorage.setItem("data",JSON.stringify(profiles));
		updateGraph();
	}
};

